      INSTALLATION


      This package utilizes a Java-based installer (similar to the one used with the Network Addon Mod), and can also be opened and installed manually using 7-Zip or Keka.


      To install it, you'll either need the Java Runtime Environment to run the installer--Adoptium's open-source edition is recommended--or a zip tool capable of opening the installer to allow manual
      installation. For Windows/Linux, use 7-zip, and for macOS, use Keka.


      Once into the installer, after agreeing to the terms for the package, click to the Files tab to select which dependencies you wish to install (making no changes here will install everything).
      Then, click to the Location tab to set up an installation location (this should be the root of your My DocumentsSimCity 4Plugins folder). On the Cleanup tab, click "Start scan" to find any
      outdated files that currently reside in your Plugins folder that may conflict with this package. Clicking "Backup" will remove these old files to a safe location. (The option to "Delete" them
      also exists, but is not recommended.) After this, click over to the Install tab, and click "Start installation" to begin the installation procedure. When installation is complete, the tab pop up
      a message indicating it, after which you are safe to close the installer.


      It is highly recommended to run the cleanitol with the installer and remove any previous versions from your plugins.

      Optionally in the ~Documents folder in the main ZIP you can find the all the individual cleanitol files and by using either the newer nos.17's SC4 Cleanitol or the older BSC Cleanitol tool you
      can search and remove old and outdated versions of these files.
